# --- Model initialization ---
device = torch.device("cuda" if torch.cuda.is_available() else "cpu")
print(device)
model = BasicUNet().to(device)
criterion = nn.BCELoss()
optimizer = optim.Adam(model.parameters(), lr=1e-3)

# --- Scheduler & Early stopping ---
scheduler = optim.lr_scheduler.ReduceLROnPlateau(optimizer, mode='min', factor=0.5, patience=5)
patience = 10
best_val_loss = float("inf")
epochs_no_improve = 0

# --- Training loop ---
n_epochs = 100
train_losses, val_losses = [], []
train_dices, val_dices = [], []

for epoch in range(n_epochs):
    # ---------------- TRAIN ----------------
    model.train()
    train_loss = 0.0
    train_dice = 0.0
    loop = tqdm(train_loader, total=len(train_loader), desc=f"Epoch [{epoch+1}/{n_epochs}]")

    for imgs, masks in loop:
        imgs, masks = imgs.to(device), masks.to(device)

        optimizer.zero_grad()
        outputs = model(imgs)
        loss = criterion(outputs, masks)
        loss.backward()
        optimizer.step()

        train_loss += loss.item()
        train_dice += dice_coefficient(outputs, masks)

        loop.set_postfix(loss=loss.item(), dice=dice_coefficient(outputs, masks))

    train_loss /= len(train_loader)
    train_dice /= len(train_loader)
    train_losses.append(train_loss)
    train_dices.append(train_dice)

    # ---------------- VALIDATION ----------------
    model.eval()
    val_loss = 0.0
    val_dice = 0.0
    with torch.no_grad():
        for imgs, masks in val_loader:
            imgs, masks = imgs.to(device), masks.to(device)
            outputs = model(imgs)
            loss = criterion(outputs, masks)
            val_loss += loss.item()
            val_dice += dice_coefficient(outputs, masks)

    val_loss /= len(val_loader)
    val_dice /= len(val_loader)
    val_losses.append(val_loss)
    val_dices.append(val_dice)

    scheduler.step(val_loss)

    print(f"\nEpoch [{epoch+1}/{n_epochs}] | "
          f"Train Loss: {train_loss:.4f} | Train Dice: {train_dice:.4f} | "
          f"Val Loss: {val_loss:.4f} | Val Dice: {val_dice:.4f}")

    # ---------------- EARLY STOPPING ----------------
    if val_loss < best_val_loss:
        best_val_loss = val_loss
        epochs_no_improve = 0
        torch.save(model.state_dict(), "best_model_unet.pth")
        print(" Saved new best model.")
    else:
        epochs_no_improve += 1
        print(f"No improvement for {epochs_no_improve} epoch(s).")

    if epochs_no_improve >= patience:
        print(" Early stopping triggered!")
        break


